import Link from 'next/link';
import NavSide from 'components/site/layout/NavSide';

// <NavItem data={route} key={index} />
export default ({ routes = [] }) => {
  return (
    <nav>
      <NavSide side="left">
        {
          routes.find(({ order }) => order === 0).name
          // .map((route, index) => (
          //   <div key={index}>{route.name}</div>
          // ))
        }
      </NavSide>
      <NavSide side="right">
        {routes.map((route, index) => (
          <div key={index}>{route.name}</div>
        ))}
      </NavSide>

      <style jsx>{`
        nav {
          display: flex;
          position: relative;
        }
      `}</style>
    </nav>
  );
};
